import React from 'react';

function SummonerProfile({ summoner }) {
  if (!summoner) return null;

  const rankInfo = summoner.rank ? `${summoner.rank.tier} ${summoner.rank.rank}` : 'Unranked';

  return (
    <div id="summoner-info" className="card">
      <h2>Summoner Info</h2>
      <p><strong>Name:</strong> {summoner.gameName}#{summoner.tagLine}</p>
      <p><strong>Level:</strong> {summoner.summonerLevel}</p>
      <p><strong>Rank:</strong> {rankInfo}</p>
    </div>
  );
}

export default SummonerProfile;
